    return (

        <Row>
            <Col sm="6">
                {props.result.filter((pregunta, index) => pregunta.valor)}


            </Col>
        </Row>
    );
}
<Card
key={index}
body
className="my-2"
style={{
    width: '30rem'

}}
>
<CardTitle tag="h5">
    {props.contador}{pregunta.tipo}
</CardTitle>
<CardText>
{pregunta.descripcion}
 </CardText>
</Card>
